import { StyleSheet } from "react-native";

const InputTextStyle = StyleSheet.create({
    inputText: {
        borderWidth: 1,
        borderColor: "#ccc",
        borderRadius: 10,
        paddingHorizontal: 20,
        paddingVertical: 17,
        marginBottom: 10,
        borderColor: "#CBD4E1",
        fontSize: 16,
      },
      input: {},
      titleText: {
        fontSize: 15,
        marginBottom: 4,
      },
});
export default InputTextStyle;
